from PIL import Image
def main():
    csv = open("./data/attr.csv",'w')
    for i in range(1000,2130):
        im = Image.open("./slicedImages/"+str(i)+".jpg")
        if(letters[i-1000]=='?'): continue
        for x in range(10):
            for y in range(10):
                tmp = im.getpixel((x,y))
                csv.write(str(tmp))
                csv.write(',')
        csv.write(str(alpha.index(letters[i-1000]))+'\n')
    csv.close()

if __name__ == "__main__":
    main()
